//KEYBOARD FUNCS
void handler (void){
	int mcause_value;
	__asm__ volatile ("csrr %0, mcause" : "=r"(mcause_value));

	//ps2 keyboard port irq22 (BINARY 22) 0b10000000000000000000000000010110
	if (mcause_value == 0b10000000000000000000000000010110) 
		KEYBOARD_ISR(); //make keybaord isr!
		
	// else, ignore the trap
}

void KEYBOARD_ISR(){
	volatile int * PS2_ptr = (int *)PS2_BASE;
	
	int PS2_data = *(PS2_ptr); // read the Data register in the PS/2 port
	int RVALID = PS2_data & 0x8000; // extract the RVALID field -> just to be safe
	short int DATA = PS2_data & 0xFF; //extract data field (max 16 bit)
	
	if(RVALID){
		//if most sig 2 bytes are 11110000 -> means break -> released -> do something
		if(DATA == 0b11110000){ //on first byte of releasing
			prev_release_code = true;
			//printf("Key releasing...\n");
			
		} else if (prev_release_code) { //if previous was 11110000, on second byte of releasing, store the released val
			prev_release_code = false;
			//printf("Key released! Storing letter...\n"); 
			
			//DATA is actual letter
			char letter = '\0'; //null char
			int function = -1; //= 0 for back, 1 for enter, 2 for unknown char, 3 reset, -1 for unset
			
			//very long switch
			switch (DATA) {
				case 0x1C: letter = 'a'; printf("%c\n", letter); break;
				case 0x32: letter = 'b'; printf("%c\n", letter); break;
				case 0x21: letter = 'c'; printf("%c\n", letter); break;
				case 0x23: letter = 'd'; printf("%c\n", letter); break;
				case 0x24: letter = 'e'; printf("%c\n", letter); break;
				case 0x2B: letter = 'f'; printf("%c\n", letter); break;
				case 0x34: letter = 'g'; printf("%c\n", letter); break;
				case 0x33: letter = 'h'; printf("%c\n", letter); break;
				case 0x43: letter = 'i'; printf("%c\n", letter); break;
				case 0x3B: letter = 'j'; printf("%c\n", letter); break;
				case 0x42: letter = 'k'; printf("%c\n", letter); break;
				case 0x4B: letter = 'l'; printf("%c\n", letter); break;
				case 0x3A: letter = 'm'; printf("%c\n", letter); break;
				case 0x31: letter = 'n'; printf("%c\n", letter); break;
				case 0x44: letter = 'o'; printf("%c\n", letter); break;
				case 0x4D: letter = 'p'; printf("%c\n", letter); break;
				case 0x15: letter = 'q'; printf("%c\n", letter); break;
				case 0x2D: letter = 'r'; printf("%c\n", letter); break;
				case 0x1B: letter = 's'; printf("%c\n", letter); break;
				case 0x2C: letter = 't'; printf("%c\n", letter); break;
				case 0x3C: letter = 'u'; printf("%c\n", letter); break;
				case 0x2A: letter = 'v'; printf("%c\n", letter); break;
				case 0x1D: letter = 'w'; printf("%c\n", letter); break;
				case 0x22: letter = 'x'; printf("%c\n", letter); break;
				case 0x35: letter = 'y'; printf("%c\n", letter); break;
				case 0x1A: letter = 'z'; printf("%c\n", letter); break;
				case 0x66: //backspace: delete the letter
					printf("BACKSPACE! Deleting letter...\n");
					function = 0;
					break;
				case 0x5A: //enter: lock in the word
					printf("ENTER! Locking in word...\n");
					function = 1;
					break;
				/*case 0x29: //space: reset (if reset = true)
					function = 3;
					break;*/
				case 0x16: //1: easy
					printf("easy mode\n");
					mode = 0;
					function = 3; //reset
					break;
				case 0x1E: //2: normal
					printf("normal mode\n");
					mode = 1;
					function = 3; //reset
					break;
				case 0x26: //3: hard
					printf("hard mode\n");
					mode = 2;
					function = 3; //reset
					break;
				default: function = 2; printf("Unknown key:\n"); break;
			}
			
			//if backspace/enter unset -> store a letter
			if(function == -1){
				
				if(wordIdx > 5){
					printf("Too many words!\n");
					return; //return before trying to enter a letter
				}
				
				if(letterIdx <= 4){ //4 is 0-indexed -> currently lower than at 5th letter or currently entering 5th letter
					 word_board[wordIdx][letterIdx] = letter;
					display_letter(letterIdx, wordIdx, letter, -1); //display letters as unset color
					letterIdx++; //increase for next loop
				} else if(letterIdx > 4) { //5th letter entered in current round/going to enter 6th word
					printf("Too many letters!\n");
					letterIdx = 5; //make letterIdx stay at null char, dont enter new letter
					return;
				} 
		
			} else if(function == 0){ //delete
				if(letterIdx > 0){ //prevent it from deleting past the 0th letter (can only go back to prev letter to delete if there is at least one letter to delete)
					letterIdx--; //go back to prev letter to delete it
					 word_board[wordIdx][letterIdx] = '\0';
					clear_slot(letterIdx, wordIdx); //clear visually
				} else {
					printf("No letter to delete!\n");
				}
				
			} else if(function == 1){ //lock in word
				
				//wordIdx5 is 0-indexed -> currently lower than 6th word or entering 6th word
				//letterIdx 5 is 0-indexed -> currently at null char -> done typing 5 letters
					//ONLY lock in if 5 letters
				if(wordIdx <= 5 && letterIdx == 5){ 
					printf("Guess: %s\n", word_board[wordIdx]);
					
					//GAME LOGIC
					char current_word_guess[6];
					strcpy(current_word_guess, word_board[wordIdx]); //put guess into a new string (dont care if its changed)
					word_compare(current_word_guess); //returns nothing, just changes the colour_of_guess array
					alpha_compare(current_word_guess);
					//GAME LOGIC
					
					if (wordIdx == 5 && !game_won){
						//6th word entering in current round, going to entering 7th word next time think it's the 6th round :(
						printf("Tries are up!\n");
						game_lost = true;
					}
					
					letterIdx = 0; //go back to beginning
					wordIdx++; //next row (new word)
					
					//reset display for next word lockin
					for(int i = 0; i < 5; i++){
						colour_of_guess[i] = -1;
					}
					
					//reset count for next guess
					find_correct_letter_count();
					
					
				}  else if (letterIdx < 5) {
					printf("Not enough letters!\n");
				}
			} else if (function == 3){
				if(reset){
					printf("STARTING NEW GAME...\n");
					reset_game();
				} //else dont reset
			}//else if function == 2 do nothing

			check_game_won(); //process game won/lost thing
			
		} else { //if previous was NOT 11110000, on only byte of pressing, do nothing
			prev_release_code = false;
			//printf("Key pressing...\n"); 
		}
	}//else dont do anything
	return;
}
